import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import {useState} from "react";

function App(){

    const [workers, setWorkers] = useState([
        {id:1, name: 'Samuel', surname: 'Jacson', count: 20, salary: 130},
        {id:2,name: 'Jam', surname: 'Luise', count: 23, salary: 110},
        {id:3,name: 'Katy', surname: 'Smitt', count: 20, salary: 100},
        {id:4,name: 'Julia', surname: 'Krosbi', count: 22, salary: 140},
        {id:5,name: 'Sam', surname: 'Venson', count: 22, salary: 160}
    ])

    const [newValue, setNewValue] = useState('');


        const countChangeHandler = (e) => {
            setNewValue(e.target.value)

           }
          setWorkers(newValue)

    return(
            <table>
                <thead>
                <tr>
                    <th> Name </th>
                    <th> Surname </th>
                    <th> Count days </th>
                    <th> Salary per day </th>
                    <th> Salary per month </th>
                </tr>
                </thead>
                <tbody>
                {workers.map(worker => (
                    <tr key={worker.id}>
                        <td>{worker.name}</td>
                        <td>{worker.surname}</td>
                        <input onChange={countChangeHandler} value={newValue} />
                        <td>{worker.salary}</td>
                        <td>{worker.salary * worker.count}</td>
                    </tr>
                ))}
                </tbody>
            </table>

        )

}

export default App;
